import React from 'react'

const ProjectNav = ({dataItems}) => {
    // remove duplicates
    const allCategories = [...new Set(dataItems.map((item) => item.category))]

    return (
        <nav style={{color: 'white'}}>
            {dataItems.map((items) => {
                const {category, id} = items;
                <h1 key={id}>{category}</h1>
            })}
        </nav>
    )
}

export default ProjectNav
